import React, { useState } from "react";

function App() {
  const [helloMessage, setHelloMessage] = useState("");
  return (
    <div className="App">
      <header className="App-header">
        <button>Press to connect to backend</button>
        {helloMessage}
      </header>
    </div>
  );
}

export default App;
